import React, { Component } from "react"
import ListItem from "./list-item"

class ChatList extends Component {
    constructor() {
        super()
    }

    render() {
        return (
            <div>
                {this.props.items.map((item) => {
                    return (
                        <ListItem
                            info={item}
                            onDelete={this.props.oDelete}
                            onDisplay={this.handleDisplay}
                        />
                    )
                })}
            </div>
        )
    }
}

export default ChatList
